import React from "react";
import { Link } from "react-router-dom";
import Logout from "../components/Logout";

const Home = () => {
    return (
        <div>
            <div>
                <h1>Home</h1>
            </div>

            <Link to="/profile" className="btn btn-primary">Go to my profile</Link>
            <Logout/>
        </div>
    )

}

export default Home;
